import { Component } from "react";

class Card extends Component {
  render() {
    console.log(this.props);
    const { nameMonster, idMonster, emailMonster } = this.props;
    return (
      <div className="card-container">
        <img alt={nameMonster} src={`https://robohash.org/${idMonster}`}></img>
        <h1 key={idMonster}>{nameMonster}</h1>
        <p>{emailMonster}</p>
      </div>
    );
  }
}

export default Card;
